 To learn more about Decision Trees, check out the resources at the end of this notebook.  [The visual description of ML and Decision Trees](http://www.r2d3.us/visual-intro-to-machine-learning-part-1/) provides nice intuition helpful to understand this notebook, and [Wikipedia](https://en.wikipedia.org/wiki/Decision_tree_learning) gives lots of details.\n\n**Data**: We use the classic MNIST handwritten digit recognition dataset.  It is from LeCun et al. (1998) and may be found under [\"mnist\" at the LibSVM dataset page](https://www.csie.ntu.edu.tw/~cjlin/libsvmtools/datasets/multiclass.html#mnist).\n\n**Goal**: Our goal for our data is to learn how to recognize digits (0 - 9) from images of handwriting.  However, we will focus on understanding trees, not on this particular learning problem.\n\n**Takeaways**: Decision Trees take several hyperparameters which can affect the accuracy of the learned model.  There is no one \"best\" setting for these for all datasets.  To get the optimal accuracy, we need to tune these hyperparameters based on our data.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"be649dc5-2e86-4ecd-82fd-bd5e838b08c5"},{"version":"CommandV1","origId":195480,"guid":"e3ed5123-9249-4af6-886e-987d8bf77665","subtype":"command","commandType":"auto","position":2.5,"command":"%md\n## Let's Build Intuition for Learning with Decision Trees\n\n* Right-click and open the following link in a new e":"label","type":"\"double\"","metadata":"{}"},{"name":"features","type":"{\"type\":\"udt\",\"class\":\"org.apache.spark.ml.linalg.VectorUDT\",\"pyClass\":\"pyspark.ml.linalg.VectorUDT\",\"sqlType\":{\"type\":\"struct\",\"fields\":[{\"name\":\"type\",\"type\":\"byte\",\"nullable\":false,\"metadata\":{}},{\"name\":\"size\",\"type\":\"integer\",\"nullable\":true,\"metadata\":{}},{\"name\":\"indices\",\"type\":{\"type\":\"array\",\"elementType\":\"integer\",\"containsNull\":false},\"nullable\":true,\"metadata\":{}},{\"name\":\"values\",\"type\":{\"type\":\"array\",\"elementType\":\"double\",\"containsNull\":false},\"nullable\":true,\"metadata\":{}}]}}","metadata":"{\"numFeatures\":780}"}],"overflow":true,"aggData":[],"aggSchema":[],"aggOverflow":false,"aggSeriesLimitReached":false,"aggError":"","aggType":"","plotOptions":null,"isJsonSchema":true,"dbfsResultPath":null,"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1505585096645,"submitTime":1505585108203,"finishTime":1505585096928,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"7b93e08a-2011-4b75-979d-23d7a09fd495"},{"version":"CommandV1","origId":195488,"guid":"559d954b-7300-475e-961c-24426d635dda","subtype":"command","commandType":"auto","position":8.0,"command":"%md\nThe pixel intensities are represented in `features` as a sparse vector, for example the first observation, as seen in row 1 of the output to `display(training)` or `training.show(2,false)` above, has `label` as `5`, i.e. the hand-written image is for the number 5.  And this hand-written image is the following sparse vector (just click the triangle to the left of the feature in first row to see the following):\n```\ntype: 0\nsize: 780\nindices: [152,153,155,...,682,683]\nvalues: [3, 18, 18,18,126,...,132,16]\n```\nHere \n* `type: 0` says we have a sparse vector that only represents non-zero entries (as opposed to a dense vector where every entry is represented).\n* `size: 780` says the vector has 780 indices in total \n * these indices from 0,...,779 are a unidimensional indexing of the two-dimensional array of pixels in the image\n* `indices: [152,153,155,...,682,683]` are the indices from the `[0,1,...,779]` possible indices with non-zero values \n  * a value is an integer encoding the gray-level at the pixel index\n* `values: [3, 18, 18,18,126,...,132,16]` are the actual gray level values, for example:\n  * at pixed index `152` the gray-level value is `3`, \n  * at index `153` the gray-level value is `18`,\n  * ..., and finally at\n  * at index `683` the gray-level value is `18`\n","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"bf0eac0f-ba6e-4010-abe7-a379e77c67e4"},{"version":"CommandV1","origId":195489,"guid":"2e8d5ede-f2e1-4257-a0e7-92e8fa35b99d","subtype":"command","commandType":"auto","position":9.0,"command":"%md\n## Train a Decision Tree\n\nWe begin by training a decision tree using the default settings.  Before training, we want to tell the algorithm that the labels are categories 0 ,"origId":195675,"guid":"a525a1ce-9162-4126-b5e6-703afec19a0e","subtype":"command","commandType":"auto","position":22.0,"command":"f1MetricPerformanceMeasures.show()","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">+--------+-------------------+\n|maxDepth|                 f1|\n+--------+-------------------+\n|       0|  0.023138302649304|\n|       1|0.07684194241456495|\n|       2|0.21424979609445727|\n|       3|0.43288417913985733|\n|       4| 0.5918599114483921|\n|       5| 0.6799688659857508|\n|       6|  0.749398509702895|\n|       7|  0.789045306607664|\n+--------+-------------------+\n\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1505585547249,"submitTime":1505585560121,"finishTime":1505585547431,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"66876bd7-9b00-4c2c-ab46-656a2055f329"},{"version":"CommandV1","origId":195507,"guid":"ed032a06-a6ac-4477-b019-35b17cfc1158","subtype":"command","commandType":"auto","position":23.0,"command":"%md\nEven though deeper trees are more powerful, they are not always better (recall from the SF/NYC city classification from house features at  [The visual description of ML and Decision Trees](http://www.r2d3.us/visual-intro-to-machine-learning-part-1/)).  If we kept increasing the depth on a rich enough dataset, training would take longer and longer.  We also might risk [overfitting](https://en.wikipedia.org/wiki/Overfitting) (fitting the training data so well that our predictions get worse on test data); it is important to tune parameters *based on [held-out data](https://en.wikipedia.org/wiki/Test_set)* to prevent overfitting. This will ensure that the fitted model generalizes well to yet unseen data, i.e. minimizes [generalization error](https://en.wikipedia.org/wiki/Generalization_error) in a mathematical statistical sense.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"92c4390c-e699-4631-a457-e9da54c2c0e4"},{"version":"CommandV1","origId":195508,"guid":"83e440e5-7b4a-4fc8-9ad7-8a376783179e","subtype":"command","commandType":"auto","position":24.0,"command":"%md\n## Exploring \"maxBins\": discretization for efficient distributed computing\n\nThis section explores a more expert-level setting `maxBins`.  For efficient distributed training of Decision Trees, Spark and most other libraries discretize (or \"bin\") continuous features (such as pixel values) into a finite number of values.  This is an important step for the distributed implementation, but it introduces a tradeoff: Larger `maxBins` mean your data will be more accurately represented, but it will also mean more communication (and slower training).\n\nThe default value of `maxBins` generally works, but it is interesting to explore on our handwritten digit dataset.  Remember our digit image from above:\n\n![Image of a digit](http://training.databricks.com/databricks_guide/digit.png)\n\nIt is grayscale.  But if we set `maxBins = 2`, then we are effectively making it a black-and-white image, not grayscale.  Will that affect the accuracy of our model?  Let's see!\n\n*Note: The next cell can take about 35 seconds to run since it trains several trees.*\nRead the details on `maxBins` at [mllib-decision-tree.html#split-candidates](http://spark.apache.org/docs/latest/mllib-decision-tree.html#split-candidates).","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"8a9000ea-efb0-4a82-b94b-7f6f96eafbfd"},{"version":"CommandV1","origId":195509,"guid":"d270f582-7727-423f-ad90-0139ded2c92a","subtype":"command","commandType":"auto","position":24.75,"command":"%md\n\nSee [http://spark.apache.org/docs/latest/mllib-decision-tree.html#split-candidates](http://spark.apache.org/docs/latest/mllib-decision-tree.html#split-candidates).","commandVersion":0,"state":"finished","results":{"type":"htmlSandbox","data":"<iframe \n src=\"http://spark.apache.org/docs/latest/mllib-decision-tree.html#split-candidates\"\n width=\"95%\" height=\"300\"\n sandbox>\n  <p>\n    <a href=\"http://spark.apache.org/docs/latest/ml-features.html\">\n      Fallback link for browsers that, unlikely, don't support frames\n    </a>\n  </p>\n</iframe>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1458251080550,"submitTime":1458250973935,"finishTime":1458251080617,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"b10492df-4b73-49ec-a97e-24410c33b2fd"},{"version":"CommandV1","origId":195510,"guid":"941f031c-2748-4db7-b49d-11866d5fff0f","subtype":"command","commandType":"auto","position":25.0,"command":"dtc.setMaxDepth(6) // Set maxDepth to a reasonable value.\n// now try the maxBins \"hyper-parameter\" which actually acts as a \"coarsener\" \n//     mathematical researchers should note that it is a sub-algebra of the finite \n//     algebra of observable pixel images at the finest resolution available to us\n// giving a compression of the image to fewer coarsely represented pixels\nval f1MetricPerformanceMeasures = Seq(2, 4, 8, 16, 32).map { case maxBins =>\n  // For this value of maxBins, learn a tree.\n  dtc.setMaxBins(maxBins)\n  val pipeline = new Pipeline().setStages(Array(indexer, dtc))\n  val model = pipeline.fit(training)\n  // Make predictions on test data, and compute accuracy.\n  val predictions = model.transform(test)\n  (maxBins, evaluator.evaluate(predictions))\n}.toDF(\"maxBins\", \"f1\")","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">f1MetricPerformanceMeasures: org.apache.spark.sql.DataFrame = [maxBins: int, f1: double]\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":"Cancelled","error":null,"workflows":[],"startTime":1505587265195,"submitTime":1505587278165,"finishTime":1505587308953,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"f9b1fa38-5428-41fb-a28a-adde4a0e7499"},{"version":"CommandV1","origId":195678,"guid":"5379d791-d994-4f7d-ac4a-2df47db4ea0a","subtype":"command","commandType":"auto","position":25.5,"command":"f1MetricPerformanceMeasures.show()","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">+-------+------------------+\n|maxBins|                f1|\n+-------+------------------+\n|      2|0.7426994211960694|\n|      4|0.7387142919572773|\n|      8|0.7442687954544963|\n|     16|0.7444933838771777|\n|     32| 0.749398509702895|\n+-------+------------------+\n\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[],"datasetInfos":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1505587313749,"submitTime":1505587326630,"finishTime":1505587313921,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"6217eea7-9dbf-40cd-b118-2a05e286fb25"},{"version":"CommandV1","origId":195511,"guid":"4b8dc3d8-fe37-4f78-a3aa-1467f591aa71","subtype":"command","commandType":"auto","position":26.0,"command":"%md\nWe can see that extreme discretization (black and white) hurts performance as measured by F1-error, but only a bit.  Using more bins increases the accuracy (but also makes learning more costly).","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"cd135f0b-dc42-42ff-a353-b81e03210982"},{"version":"CommandV1","origId":195512,"guid":"bbbe548e-69c0-467a-bfdd-c01329f99216","subtype":"command","commandType":"auto","position":27.0,"command":"%md\n#### What's next?\n\n* **Explore**: Try out tuning other parameters of trees---or even ensembles like [Random Forests or Gradient-Boosted Trees](http://spark.apache.org/docs/latest/ml-classification-regression.html#tree-ensembles).\n* **Automated tuning**: This type of tuning does not have to be done by hand.  (We did it by hand here to show the effects of tuning in detail.)  MLlib provides automated tuning functionality via `CrossValidator`.  Check out the other Databricks ML Pipeline guides or the [Spark ML user guide](http://spark.apache.org/docs/latest/ml-guide.html) for details.\n\n**Resources**\n\nIf you are interested in learning more on these topics, these resources can get you started:\n* [Excellent visual description of Machine Learning and Decision Trees](http://www.r2d3.us/visual-intro-to-machine-learning-part-1/)\n  * *This gives an intuitive visual explanation of ML, decision trees, overfitting, and more.*\n* [Blog post on MLlib Random Forests and Gradient-Boosted Trees](https://databricks.com/blog/2015/01/21/random-forests-and-boosting-in-mllib.html)\n  * *Random Forests and Gradient-Boosted Trees combine many trees into more powerful ensemble models.  This is the original post describing MLlib's forest and GBT implementations.*\n* Wikipedia\n  * [Decision tree learning](https://en.wikipedia.org/wiki/Decision_tree_learning)\n  * [Overfitting](https://en.wikipedia.org/wiki/Overfitting)\n  * [Hyperparameter tuning](https://en.wikipedia.org/wiki/Hyperparameter_optimization)","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":0,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"9433b050-8447-402e-85cb-695d0233f7db"}],"dashboards":[],"guid":"2b894fa5-cf8f-413e-966f-e489e57ad499","globalVars":{},"iPythonMetadata":null,"inputWidgets":{}};</script>
